            <div class="t m0 x3 h3 y3 ff1 fs2 fc0 sc0 ls0 ws0">the self check-in points in the airport.</div>
            <div class="t m0 x4 h4 y4 ff1 fs3 fc1 sc0 ls0 ws0">© Emirates. All rights reserved</div>
            <div class="t m0 x5 h5 y5 ff2 fs4 fc1 sc0 ls0 ws0">Emirates Experience | Check-in Online | Manage a Booking | Baggage | Contact us</div>
            <div class="t m0 x6 h4 y4 ff1 fs3 fc1 sc0 ls0 ws0">Page 3 of 3</div>
            <div class="t m0 x8 h15 y6a ff6 fsc fc0 sc0 ls0 ws0">Hazardous materials notification</div>
            <div class="t m0 x8 h16 y6b ff4 fs6 fc0 sc0 ls0 ws0">The carriage of certain hazardous materials like aerosols, fireworks and inflammable liquids aboard the aircraft is forbidden. If you do not understand this restriction, further</div>
            <div class="t m0 x8 h16 y6c ff4 fs6 fc0 sc0 ls0 ws0">information may be obtained from your airline.</div>
            <div class="t m0 x8 h16 y6d ff4 fs6 fc0 sc0 ls0 ws0">With immediate effect, personal motorised vehicles such as hoverboards, mini-Segways and smart or self-balancing wheels, are forbidden on our flights as they contain</div>
            <div class="t m0 x8 h16 y6e ff4 fs6 fc0 sc0 ls0 ws0">large lithium batteries. For safety reasons, we can&apos;t accept these as part of checked-in baggage or as hand luggage.</div>
            <div class="t m0 x8 h17 y6f ff2 fs6 fc0 sc0 ls0 ws0">In light of advisories from various aviation regulatory bodies and concerns raised by Samsung about its Galaxy Note 7 smartphones, passengers are advised</div>
            <div class="t m0 x8 h17 y70 ff2 fs6 fc0 sc0 ls0 ws0">that these devices are prohibited on all Emirates flights. Passengers are requested not to bring them on board Emirates&apos; flights in person, as well as in carry-on</div>
            <div class="t m0 x8 h17 y71 ff2 fs6 fc0 sc0 ls0 ws0">or checked-in baggage.</div>
            <div class="t m0 x8 h15 y72 ff6 fsc fc0 sc0 ls0 ws0">E<span class="_ _4"></span>mirates cabin baggage allowances</div>
            <div class="t m0 x8 h17 y73 ff2 fs6 fc0 sc0 ls0 ws0">Economy Class:</div>
            <div class="t m0 x8 h16 y74 ff4 fs6 fc0 sc0 ls0 ws0">One piece of carry-on baggage is permitted with maximum dimensions: 55 x 38 x 20cm (22 x 15 x 8 inches) and maximum weight: 7kg (15lb).</div>
            <div class="t m0 x8 h16 y75 ff4 fs6 fc0 sc0 ls0 ws0">Note: If you’re boarding in India, your carry-on baggage may not exceed 115cm or 45.3 inches (length + width + height). If your itinerary originates from Brazil, you’re</div>
            <div class="t m0 x8 h16 y76 ff4 fs6 fc0 sc0 ls0 ws0">allowed a carry-on weighing 10kg (22lb).</div>
            <div class="t m0 x8 h17 y77 ff2 fs6 fc0 sc0 ls0 ws0">First Class and Business Class:</div>
            <div class="t m0 x8 h16 y78 ff4 fs6 fc0 sc0 ls0 ws0">Two pieces of carry-on baggage permitted: one briefcase plus either one handbag or one garment bag. The briefcase may not exceed 45 x 35 x 20cm (18 x 14 x 8 inches);</div>
            <div class="t m0 x8 h16 y79 ff4 fs6 fc0 sc0 ls0 ws0">the handbag may not exceed 55 x 38 x 20cm (22 x 15 x 8 inches); the garment bag can be no more than 20cm (8 inches) thick when folded. The total combined weight of</div>
            <div class="t m0 x8 h16 y7a ff4 fs6 fc0 sc0 ls0 ws0">both pieces may not be more than 14kg (30lb).</div>
            <div class="t m0 x8 h16 y7b ff4 fs6 fc0 sc0 ls0 ws0">Infants in all cabin classes are permitted one checked-in bag that may not exceed 55 x 38 x 20 cm (22 x 15 x 8 inches) in size and 23kg (50lb) where the piece concept</div>
            <div class="t m0 x8 h16 y7c ff4 fs6 fc0 sc0 ls0 ws0">applies, or 10kg (22lb) where the weight concept applies. In addition, customers travelling with infants (and without a child seat) are permitted to bring one carry-cot or one</div>
            <div class="t m0 x8 h16 y7d ff4 fs6 fc0 sc0 ls0 ws0">fully collapsible stroller into the cabin if there is room. If there is no space for these items in the cabin, they will have to be checked. However, if checked, they will not count</div>
            <div class="t m0 x8 h16 y7e ff4 fs6 fc0 sc0 ls0 ws0">against your baggage allowance.</div>
            <div class="t m0 x8 h15 y7f ff6 fsc fc0 sc0 ls0 ws0">E<span class="_ _4"></span>mirates checked baggage notification</div>
            <div class="t m0 x8 h16 y80 ff4 fs6 fc0 sc0 ls0 ws0">Checked baggage allowances vary by fare type and class of travel. Check your baggage allowance, however please note that any individual item weighing more than 32kg</div>
            <div class="t m0 x8 h16 y81 ff4 fs6 fc0 sc0 ls0 ws0">cannot be accepted, for health and safety reasons.</div>
            <div class="t m2 x17 h2 y82 ff1 fs3 fc6 sc0 ls0 ws0">Ticket number:<span class="fs1">{{$ticket_number}}</span></div>
