            <div class="t m0 x1e h19 y86 ff3 fs2 fc0 sc0 ls0 ws0">Fall in love with a classic romance or immerse yourself in</div>
            <div class="t m0 x1e h19 y87 ff3 fs2 fc0 sc0 ls0 ws0">the latest edge-of-the-seat blockbuster - let our ice inflight</div>
            <div class="t m0 x1e h19 y88 ff3 fs2 fc0 sc0 ls0 ws0">entertainment take you to places you won&apos;t find on a map.</div>
            <div class="t m0 x1e h19 y89 ff3 fs2 fc0 sc0 ls0 ws0">Choose from over 2,500 channels of movies, TV shows and</div>
            <div class="t m0 x1e h19 y8a ff3 fs2 fc0 sc0 ls0 ws0">music from around the world and in multiple languages. Or</div>
